import React from 'react'
import { Button, Box, Flex, Text } from '@chakra-ui/react'
import { DeleteIcon } from '@chakra-ui/icons'

function Task(props) {
    const { text } = props;
    return (
            <Box>
                <Text>{text}</Text>
                <Button colorScheme='red'>
                    <DeleteIcon />
                </Button>
            </Box>
    )
}

export default Task
